import React from "react";
import Login from "./components/Login";
import { Route, Router, Routes } from "react-router-dom";

function App() {
  return (
    <Router>
      <Routes>
        <Route path="/" element={<Login />} />
        <Route path="/profile" element={<Profiel />} />
      </Routes>
    </Router>
  );
}

export default App;
